import React from 'react'

const Table = (props) => {
    return (
        <table className="table table-striped">
        <thead>
          <tr>
            <th>Дата</th>
            <th>Название</th>
            <th>Количество</th>
            <th>Расстояние</th>
          </tr>
        </thead>
        <tbody>
          {
            props.data.map(
              item => (
                <tr key={item.id}>
                  <td>{item.date.slice(0, 10)}</td>
                  <td>{item.name}</td>
                  <td>{item.quanity}</td>
                  <td>{item.distance}</td>
                </tr>
              )
            )
          }
        </tbody>
      </table>
    )
}

export default Table
